{
  "translationLines": [
    {
      "lineNumber": 122071,
      "originalJapaneseLine": "　儂の腕のせいじゃないわい！",
      "translatedEnglishLine": "It's not because of my skill!"
    },
    {
      "lineNumber": 122072,
      "originalJapaneseLine": "「ホントかなー？　疑わしいなー？」",
      "translatedEnglishLine": "'Is that really so? Sounds suspicious, doesn't it?'"
    },
    {
      "lineNumber": 122073,
      "originalJapaneseLine": "「むかむかむかむか……！」",
      "translatedEnglishLine": "'Grrr, grrrr...!'"
    },
    {
      "lineNumber": 122074,
      "originalJapaneseLine": "「おーーーっ、上等じゃ！",
      "translatedEnglishLine": "'Ohhhh, very well then!'"
    },
    {
      "lineNumber": 122075,
      "originalJapaneseLine": "　そんなに言うならやったるわい！",
      "translatedEnglishLine": "If you say so much, I'll do it!"
    },
    {
      "lineNumber": 122076,
      "originalJapaneseLine": "プンスカ怒って、ドエススキーは",
      "translatedEnglishLine": "Fuming with anger, Doesusuki"
    },
    {
      "lineNumber": 122077,
      "originalJapaneseLine": "自分の部屋へ向かって行った。",
      "translatedEnglishLine": "headed toward her own room."
    },
    {
      "lineNumber": 122078,
      "originalJapaneseLine": "「がははは、ちょろい奴め」",
      "translatedEnglishLine": "'Gahaha, what an easy mark.'"
    },
    {
      "lineNumber": 122079,
      "originalJapaneseLine": "「あいつが書いた俺様主役の本、",
      "translatedEnglishLine": "'The book she wrote with me as the star,"
    },
    {
      "lineNumber": 122080,
      "originalJapaneseLine": "　面白かったら沢山売ろう」",
      "translatedEnglishLine": "if it's interesting, I'll sell a lot.'"
    },
    {
      "lineNumber": 122081,
      "originalJapaneseLine": "「つまらなかったら死刑だな」",
      "translatedEnglishLine": "'If it's boring, then it's a death sentence.'"
    },
    {
      "lineNumber": 122082,
      "originalJapaneseLine": "「うう、ランス様、可哀想ですよぉ……」",
      "translatedEnglishLine": "'Ugh, Lord Rance, that's so pitiful...' "
    },
    {
      "lineNumber": 122083,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 122084,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 122085,
      "originalJapaneseLine": "二週間後――",
      "translatedEnglishLine": "Two weeks later――"
    },
    {
      "lineNumber": 122086,
      "originalJapaneseLine": "「坊主ー、いるかー？」",
      "translatedEnglishLine": "'Hey kid, are you there?'"
    },
    {
      "lineNumber": 122087,
      "originalJapaneseLine": "「おお、遂に出来たか」",
      "translatedEnglishLine": "'Oh, you finally finished it?'"
    },
    {
      "lineNumber": 122088,
      "originalJapaneseLine": "「出来た」",
      "translatedEnglishLine": "'It's done.'"
    },
    {
      "lineNumber": 122089,
      "originalJapaneseLine": "「がははは、どれどれ！？",
      "translatedEnglishLine": "'Gahaha, let me see!'"
    },
    {
      "lineNumber": 122090,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 122091,
      "originalJapaneseLine": "「……漫画だ」",
      "translatedEnglishLine": "'...It's a manga.'"
    },
    {
      "lineNumber": 122092,
      "originalJapaneseLine": "「うん、色々と考えたらこうなった」",
      "translatedEnglishLine": "'Yeah, after thinking about various things, it turned out like this.'"
    },
    {
      "lineNumber": 122093,
      "originalJapaneseLine": "「うわっ、しかも四コマ漫画だ」",
      "translatedEnglishLine": "'Wow, and it's a four-panel manga too!'"
    },
    {
      "lineNumber": 122094,
      "originalJapaneseLine": "「その名も題して『ランスくん』じゃ」",
      "translatedEnglishLine": "It is entitled 'Rance-kun.'"
    },
    {
      "lineNumber": 122095,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 122096,
      "originalJapaneseLine": "「……内容が面白いから許してやる」",
      "translatedEnglishLine": "'...I'll forgive you because the content is interesting.'"
    },
    {
      "lineNumber": 122097,
      "originalJapaneseLine": "「あ、いいんですね……」",
      "translatedEnglishLine": "'Ah, really? That's good...'"
    },
    {
      "lineNumber": 122098,
      "originalJapaneseLine": "「ふんっ、儂が書いたんじゃ、とーぜん」",
      "translatedEnglishLine": "'Hmph, of course since I wrote it.'"
    },
    {
      "lineNumber": 122099,
      "originalJapaneseLine": "「ひ、拾って下さったご恩をお返しします」",
      "translatedEnglishLine": "'I-I will repay the kindness of you taking me in.'"
    },
    {
      "lineNumber": 122100,
      "originalJapaneseLine": "「お、ビスケッタさんだ」",
      "translatedEnglishLine": "'Oh, it's Biscetta-san.'"
    },
    {
      "lineNumber": 122101,
      "originalJapaneseLine": "「およはうございます、御主人様」",
      "translatedEnglishLine": "'Good morning, Master.'"
    },
    {
      "lineNumber": 122102,
      "originalJapaneseLine": "「と……」",
      "translatedEnglishLine": "'A- and...'"
    },
    {
      "lineNumber": 122103,
      "originalJapaneseLine": "「おはようございます、御主人様」",
      "translatedEnglishLine": "'Good morning, Master.'"
    },
    {
      "lineNumber": 122104,
      "originalJapaneseLine": "「誰だお前はーーーッ！！」",
      "translatedEnglishLine": "'Who the hell are youーーー!?'"
    },
    {
      "lineNumber": 122105,
      "originalJapaneseLine": "「ええっ！？",
      "translatedEnglishLine": "'Eh!?'"
    },
    {
      "lineNumber": 122106,
      "originalJapaneseLine": "「……前にあったことあるか？",
      "translatedEnglishLine": "'...Have we met before?'"
    },
    {
      "lineNumber": 122107,
      "originalJapaneseLine": "　俺は男の顔は覚えんからな」",
      "translatedEnglishLine": "I don't remember men's faces, you see.'"
    },
    {
      "lineNumber": 122108,
      "originalJapaneseLine": "「こちらはイアン・ルストン。",
      "translatedEnglishLine": "'This is Ian Ruston."
    },
    {
      "lineNumber": 122109,
      "originalJapaneseLine": "　最近、新しく執事見習いとして雇いました。",
      "translatedEnglishLine": "Recently, we hired him as a new butler apprentice."
    },
    {
      "lineNumber": 122110,
      "originalJapaneseLine": "　ちなみに御主人様は初対面です」",
      "translatedEnglishLine": "By the way, this is the first time meeting you, Master.'"
    },
    {
      "lineNumber": 122111,
      "originalJapaneseLine": "「む、本当に見たことない顔だったか」",
      "translatedEnglishLine": "'Hmm, it really was a face I've never seen before.'"
    },
    {
      "lineNumber": 122112,
      "originalJapaneseLine": "「って、執事だとぉー？」",
      "translatedEnglishLine": "'A- a butler!?'"
    },
    {
      "lineNumber": 122113,
      "originalJapaneseLine": "「ロナと同様に彼もまた、",
      "translatedEnglishLine": "'Just like Rona, he too"
    },
    {
      "lineNumber": 122114,
      "originalJapaneseLine": "　魔人レッドアイに誘拐されていたようで……",
      "translatedEnglishLine": "seems to have been kidnapped by the Demon Red Eye..."
    },
    {
      "lineNumber": 122115,
      "originalJapaneseLine": "　それを見つけてこうして保護を」",
      "translatedEnglishLine": "We found him and took him in like this.'"
    },
    {
      "lineNumber": 122116,
      "originalJapaneseLine": "「むむむ……」",
      "translatedEnglishLine": "'Hmmmm...'"
    },
    {
      "lineNumber": 122117,
      "originalJapaneseLine": "「執事ってのは男、ってことだよな？」",
      "translatedEnglishLine": "'A butler means a man, right?'"
    },
    {
      "lineNumber": 122118,
      "originalJapaneseLine": "「左様でございます」",
      "translatedEnglishLine": "'That is correct.'"
    },
    {
      "lineNumber": 122119,
      "originalJapaneseLine": "「うむうむ、そうだな。",
      "translatedEnglishLine": "'Hmm hmm, that's right."
    },
    {
      "lineNumber": 122120,
      "originalJapaneseLine": "　女の執事なんて聞いたことないもんな」",
      "translatedEnglishLine": "I've never heard of a female butler.'"
    },
    {
      "lineNumber": 122121,
      "originalJapaneseLine": "「男はいらーーーん！」",
      "translatedEnglishLine": "'I don't want a manーーー!'"
    },
    {
      "lineNumber": 122122,
      "originalJapaneseLine": "「ええっ！？",
      "translatedEnglishLine": "'Eh!?'"
    },
    {
      "lineNumber": 122123,
      "originalJapaneseLine": "「俺の世話をするのは奴隷か、",
      "translatedEnglishLine": "'The one who takes care of me should be a slave,"
    },
    {
      "lineNumber": 122124,
      "originalJapaneseLine": "　見目麗しいメイドと決まってるのだ。",
      "translatedEnglishLine": "or a beautiful-looking maid, that's certain."
    },
    {
      "lineNumber": 122125,
      "originalJapaneseLine": "　ガキとは言え男の執事なんていらん」",
      "translatedEnglishLine": "Even if he's a kid, I don't need a male butler.'"
    },
    {
      "lineNumber": 122126,
      "originalJapaneseLine": "「はい、そう仰られると思い、",
      "translatedEnglishLine": "'Yes, I thought you would say that,"
    },
    {
      "lineNumber": 122127,
      "originalJapaneseLine": "　彼に御主人様のお世話をさせる気はありません」",
      "translatedEnglishLine": "so I have no intention of having him take care of Master.'"
    },
    {
      "lineNumber": 122128,
      "originalJapaneseLine": "「これは今まで御主人様には",
      "translatedEnglishLine": "'This is something I haven't told you until now, Master..."
    },
    {
      "lineNumber": 122129,
      "originalJapaneseLine": "　お話していないことでしたが……",
      "translatedEnglishLine": "something I had yet to mention..."
    },
    {
      "lineNumber": 122130,
      "originalJapaneseLine": "「城に来る各国の兵の中には、",
      "translatedEnglishLine": "'Among the soldiers coming to the castle from various countries,"
    }
  ]
}

